import { Outlet } from "react-router-dom";

const MoviesLayout = () => {
  return (
    <div className="movieslayout">
      <form>
        <input type="text" name="search" placeholder="search for movie..." />
        <button className="btn btn-primary">Search</button>
      </form>
      <Outlet />
    </div>

  );
};

export default MoviesLayout;
